import React from 'react';
import customTheme from '../../theme'

import {
  Flex,
  Box,
  FormControl,
  InputGroup,
  InputLeftAddon,
  Input,
  Icon
} from '@chakra-ui/core'
import Form from '../../components/Form'

function Home() {
  return (
    <Box 
      w= "100vw"
      h= "100%"
      bg= {customTheme.themeColors[100]}
     >
    <h1>Holis</h1>
    </Box>
  );
}

export default Home;
